import React from "react";
import {  StyleSheet, Text, View } from "react-native";
import { MaterialIcons } from '@expo/vector-icons';
import styled from "styled-components";
import { Button } from 'react-native-elements';
import { borderColor, flex } from "styled-system";

export default function Athlete(){
    return(
        <View style= {styles.container}>
            <Text style={styles.title}>
            <MaterialIcons name="sports" size={24} color="black" />
            <Text>종목별 체육관 찾기</Text>
            </Text>
            <ButtonStyle><MaterialIcons name="sports-soccer" size={24} color="black"/>축구</ButtonStyle>
            <Button style={styles.button} icon={<MaterialIcons name="sports-soccer" size={24} color="black"/>} title="  축구" type="outline" />
        <Button style={styles.button} icon={<MaterialIcons name="sports-soccer" size={24} color="black" />} title="  농구" type="outline" />
        <Button style={styles.button} icon={<MaterialIcons name="sports-soccer" size={24} color="black" />} title="  야구" type="outline" />
        <Button style={styles.button} icon={<MaterialIcons name="sports-soccer" size={24} color="black" />} title="  배드민턴" type="outline" />
        {/* <Button title="농구"/>
        <Button title="배구"/>
        <Button title="탁구"/>
        <Button title="배드민턴"/> */}
        </View>
    );
}
const ButtonStyle = styled.div`
display: inline-flex;
width: 64px;
height: 64px; 
border-radius: 4px;
border: 1px solid #ECECF5;
cursor: pointer;
  padding-left: 1rem;
  padding-right: 1rem;
`

const styles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: 'center',
      marginHorizontal: 16,
    },
    title: {
      textAlign: 'center',
      fontSize: 24,
      marginVertical: 8,
    },
    fixToText: {
      flexDirection: 'row',
      justifyContent: 'space-between',
    },
    separator: {
      marginVertical: 8,
      borderBottomColor: '#737373',
      borderBottomWidth: StyleSheet.hairlineWidth,
    },
    buttonSize: {
        margin : 10
    },
    button: {
      width: 80,
      height: 85,
      borderRadius: 5,
      borderColor: '#aaaaaa',
      alignItems: "center",
      backgroundColor: "#FFFFFF",
      padding: 10
      }
  });
